MERGE DSI.WorkOrder AS tgt
USING
	(SELECT
		WorkOrder_ID,
		AccountSummary_ID,
		RequestedByUserSummary_ID,
		Display_ID,
		Latitude,
		Longitude,
		StreetAddress,
		City,
		[State],
		LatLongMatchesAddress,
		WorkOrderStatusTypeCode_ID,
		WorkOrderPriorityTypeCode_ID,
		Purpose_ID,
		WorkCategory_ID,
		Trade_ID,
		RequestDateTime,
		TotalCost,
		DescriptionValue,
		ActionTakenText,
		CompletedDateTime,
		CreatedByDateTime,
		CreatedByUserSummary_ID,
		UpdatedDateTime,
		UpdatedByUserSummary_ID
	 FROM
		#WorkOrder) AS src
ON (tgt.AccountSummary_ID = src.AccountSummary_ID
	AND src.[Display_ID] = tgt.[Display_ID])
WHEN MATCHED THEN
	UPDATE SET
			   [RequestedByUserSummary_ID] = src.[RequestedByUserSummary_ID],
			   [Latitude] = src.[Latitude],
			   [Longitude] = src.[Longitude],
			   [StreetAddress] = src.[StreetAddress],
			   [City] = src.[City],
			   [State] = src.[State],
			   [LatLongMatchesAddress] = src.[LatLongMatchesAddress],
			   [WorkOrderStatusTypeCode_ID] = src.[WorkOrderStatusTypeCode_ID],
			   [WorkOrderPriorityTypeCode_ID] = src.[WorkOrderPriorityTypeCode_ID],
			   Purpose_ID = src.Purpose_ID,
			   WorkCategory_ID = src.WorkCategory_ID,
			   Trade_ID = src.Trade_ID,
			   RequestDateTime = src.RequestDateTime,
			   [TotalCost] = src.[TotalCost],
			   DescriptionValue = src.DescriptionValue,
			   ActionTakenText = src.DescriptionValue,
			   CompletedDateTime = src.CompletedDateTime,
			   CreatedByDateTime = src.CreatedByDateTime,
			   CreatedByUserSummary_ID = src.CreatedByUserSummary_ID,
			   UpdatedDateTime = src.UpdatedDateTime,
			   [UpdatedByUserSummary_ID] = src.[UpdatedByUserSummary_ID]
WHEN NOT MATCHED BY TARGET THEN
	INSERT
		   ([WorkOrderStatusTypeCode_ID],
			[WorkOrderPriorityTypeCode_ID],
			[Purpose_ID],
			[WorkCategory_ID],
			[Trade_ID],
			[RequestDateTime],
			[TotalCost],
			[DescriptionValue],
			[ActionTakenText],
			[CompletedDateTime],
			[CreatedByDateTime],
			[CreatedByUserSummary_ID],
			[UpdatedDateTime],
			[UpdatedByUserSummary_ID],
			[RequestedByUserSummary_ID],
			[AccountSummary_ID],
			[Latitude],
			[Longitude],
			[StreetAddress],
			[City],
			[State],
			[LatLongMatchesAddress],
			[Display_ID])
	VALUES (src.[WorkOrderStatusTypeCode_ID],
			src.[WorkOrderPriorityTypeCode_ID],
			src.[Purpose_ID],
			src.[WorkCategory_ID],
			src.[Trade_ID],
			src.[RequestDateTime],
			src.[TotalCost],
			src.[DescriptionValue],
			src.[ActionTakenText],
			src.[CompletedDateTime],
			src.[CreatedByDateTime],
			src.[CreatedByUserSummary_ID],
			src.[UpdatedDateTime],
			src.[UpdatedByUserSummary_ID],
			src.[RequestedByUserSummary_ID],
			src.[AccountSummary_ID],
			src.[Latitude],
			src.[Longitude],
			src.[StreetAddress],
			src.[City],
			src.[State],
			src.[LatLongMatchesAddress],
			src.[Display_ID]);
